/*
Fila: Na fila, o elemento inserido primeiro é o primeiro a ser removido (FIFO - First In, First Out). Portanto, a sequência seria: 3, 7, 9, 1, 0.

Lista: Na lista, os elementos são removidos com base em suas posições. Se removermos do início para o final, a sequência seria: 3, 7, 9, 1, 0.

Pilha: Na pilha, o elemento inserido por último é o primeiro a ser removido (LIFO - Last In, First Out). Portanto, a sequência seria: 0, 1, 9, 7, 3.
*/